import React from 'react';
import './YouTubeVideo.css';


class YouTubeVideo extends React.Component {
  render() {
    return (
      <div className="holder">
        <iframe className="video" src="https://www.youtube-nocookie.com/embed/DE58ABNvXzE" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowFullScreen="true"></iframe>
        <h1>Offsets: The first uses Bootstrap's own offset classes so it requires no change in markup and no extra CSS. The key is to set an offset equal to half of the remaining size of the row. So for example, a column of size 6 would be centered by adding an offset of 3, that's (12-6)/2.</h1>
      </div>
    );
  }
}

export default YouTubeVideo;
